import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Container } from "semantic-ui-react";

import "../css/Sidebar.css";

function App() {
  return (
    <Router>
      <Container>
        <div class="sidenav">
          <Link to="/">Home</Link>
          <Link to="/beneficiarios">Beneficiarios</Link>
          <Link to="/jornadas">Jornadas</Link>
          <Link to="/reportes">Reportes</Link>
          <Link to="/evaluaciones">Evaluaciones</Link>
          <Link to="/cuentas">Cuentas</Link>
        </div>
        <div class="main">
          <Route exact path="/" component={Home} />
          <Route path="/beneficiarios" component={Beneficiarios} />
          <Route path="/jornadas" />
          <Route path="/reportes" component={Reportes} />
          <Route path="/evaluaciones" />
          <Route path="/cuentas" component={Cuentas} />
        </div>
      </Container>
    </Router>
  );
}

function Home() {
  return (
    <div>
      <p>Home</p>
    </div>
  );
}

function Beneficiarios() {
  return (
    <div>
      <p>Beneficiarios</p>
    </div>
  );
}

function Reportes() {
  return (
    <div>
      <p>Reportes</p>
    </div>
  );
}

function Evaluaciones() {
  return (
    <div>
      <p>Evaluaciones</p>
    </div>
  );
}

function Cuentas() {
  return (
    <div>
      <p>Cuentas</p>
    </div>
  );
}

export default App;
